INSERT INTO `cd_content` VALUES ('6', '服装商城网站php+mysql', '7', '/uploads/admin/202206/62a985cf33b19.png', '<p data-we-empty-p=\"\" style=\"text-align:left;\">此网站主要是针对毕业设计所实现的，前端利用ajax与php进行交互获取数据，实现各个功能，主要的功能有：登录、注册、加入购物车、下单、个人中心、后台登录、后台会员管理、后台订单管理、后台商品管理等功能，以下为网站展示。</p><p><b><img src=\"/uploads/admin/202206/62a985cf33b19.png\" style=\"max-width:100%;\"/></b></p><p><b><img src=\"/uploads/admin/202206/62a9830e194c1.png\" style=\"max-width:100%;\"/><br/></b></p><p><img src=\"/uploads/admin/202206/62a983254dbb3.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a985e37e6ed.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a985d95c8f7.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a985fe872c2.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a986088f5f5.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a98614e31fd.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a9861f28391.png\" style=\"max-width:100%;\"/></p><p><img src=\"/uploads/admin/202206/62a98627a8073.png\" style=\"max-width:100%;\"/></p><p><br/></p>', '1', '', '', '1655277133', '', '', '36', '6', '呵呵哒');
INSERT INTO `cd_content` VALUES ('9', '创建一个新的项目', '11', '', '<p>① 新建项目空白目录，并且执行 <font color=\"#c24f4a\">npm init -y</font> 命令，初始化包管理配置文件 package.json</p><p>② 新建 <font color=\"#c24f4a\">src</font> 源代码目录</p><p>③ 新建 src -&gt; <font color=\"#c24f4a\">index.html </font>首页</p><p>④ 初始化首页基本结构</p><p>⑤ 运行 <font color=\"#c24f4a\">npm install jquery -s <font color=\"#000000\">命令，安装jq</font></font></p>', '1', '', '', '1657614498', '', '', '2', '20', '');
INSERT INTO `cd_content` VALUES ('10', '在项目中安装webpack', '11', '', '<p>① 运行<font color=\"#c24f4a\"> npm install webpack webpack-cli -D</font> 命令，安装webpack相关的包</p><p>② 在项目根目录中，创建名为<font color=\"#c24f4a\">webpack.config.js</font> 的webpack配置文件</p><p>③ 在webpack的配置文件中，初始化如下基本配置:</p><p><font color=\"#c24f4a\"><span style=\"background-color: rgb(255, 255, 255);\">modle.exports = {</span></font></p><p><font color=\"#c24f4a\"><span style=\"background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp; mode:\'development\' //<font>development(开发阶段) | production(发布阶段)<br/></font></span></font></p><p><font color=\"#c24f4a\"><span style=\"background-color: rgb(255, 255, 255);\">}</span></font></p><p>④在package.json配置文件中的scripts节点下，新增dev脚本如下:</p><p><font color=\"#c24f4a\">\"script\":{</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; \"dev\":\"webpack\" // script 节点下的脚本，可以通过 npm run 执行<br/></font></p><p><font color=\"#c24f4a\">}</font><br/></p>', '1', '', '', '1657614988', '', '', '10', '19', '');
INSERT INTO `cd_content` VALUES ('11', '配置打包的出口与入口', '11', '', '<p>webpack的4.x版本中默认约定;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 打包的<font color=\"#c24f4a\">入口文件</font>为 src&nbsp; -&gt; index.js</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 打包的<font color=\"#c24f4a\">输出文件</font>为 dist&nbsp; -&gt; main.js</p><p>如果要修改打包的入口与出口，可以在webpack.config.js中新增如下配置信息; <br/></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; const path = require(\'path\') // 导入node.js 中专门操作路径的模块</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; module.exports = {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; entry:path.join(__dirname,\'./src/index.js\'), // 打包入口文件的路径</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; output:{</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; path:path.join(__dirname,\'./dist\'), // 输出文件错放路径</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; filename:\'bundle.js\' // 输出文件的名称<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</font><br/></p>', '1', '', '', '1657615418', '', '', '5', '18', '');
INSERT INTO `cd_content` VALUES ('12', '配置webpack的自动打包功能', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm install webpack-dev-server -D</font>命令，安装支持项目自动打包的工具</p><p>② 修改package.json -&gt; scripts中的dev命令如下:</p><p><font color=\"#c24f4a\">// package.json中的配置(可以省略 默认localhost)</font></p><p><font color=\"#c24f4a\">// --open 打包完成后自动打开浏览器页面</font></p><p><font color=\"#c24f4a\">// --host 配置ip地址</font></p><p><font color=\"#c24f4a\">//--port 配置端口</font><br/></p><p>&nbsp;<font color=\"#c24f4a\">\"scripts\":{</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; \"dev\":\"webpack-dev-server --open --host 127.0.0.1 --port 8888\"&nbsp; // script节点下的脚本，可以通过npm run执行</font></p><p><font color=\"#c24f4a\">&nbsp; }</font></p><p>③ 将src -&gt; index.html中，script脚本的引用路径，修改为\"/buldle.js\"</p><p>④ 运行npm run dev命令，重新进行打包</p><p>⑤ 在浏览器中访问<font color=\"#46acc8\"><u>http://localhost:8080</u></font> 地址,查看自动打包效果</p><p>&nbsp;<font color=\"#c24f4a\">注意：</font><br/></p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; ① webpack-dev-server会启动一个实时打包的http服务器</p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; ② webpack-dev-server打包生成的输出文件，默认放到了项目根目录中，而且是虚拟的、看不见的</p><p>&nbsp;&nbsp;&nbsp;<br/></p>', '1', '', '', '1657616432', '', '', '2', '17', '');
INSERT INTO `cd_content` VALUES ('13', '配置html-webpack-plugin生成预览页面', '11', '', '<p>① 运行npm install html-webpack-plugin -D命令，安装生成预览页面的插件</p><p>② 修改webpack.config.js 文件头部区域，添加如下配置信息:</p><p>&nbsp;&nbsp;&nbsp; <font color=\"#c24f4a\">//导入生成预览页面的插件，得到一个构造函数</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; const HtmlwebpackPlugin = require ( \'html-webpack-plugin\')</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; const htmlPlugin = new HtmlWebpackPlugin ({ // 创建插件的实例对象</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; template:\'./src/index.html\', // 指定要用到的模板文件</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; filename:\'index.html\' // 指定生成的文件的名称，该文件存在于内存中，在目录中不显示</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; })</font></p><p>③ 修改webpack.config.js 文件中向外暴露的配置对象，新增如下配置节点：</p><p>&nbsp;&nbsp;<font color=\"#c24f4a\">&nbsp; module.exports = {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; plugins: [ htmlPlugin ] // plugins数组是webpack 打包期间会用到的一些插件列表</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; }</font><br/></p>', '1', '', '', '1657618627', '', '', '2', '16', '');
INSERT INTO `cd_content` VALUES ('14', '通过 loader 打包非 js 模块', '11', '/uploads/admin/202207/62ce225ba0cb5.png', '<p>在实际开发过程中，webpack 默认只能打包处理以.js后缀名结尾的模块，其他<font color=\"#c24f4a\">非.js 后缀名结尾</font></p><p><font color=\"#c24f4a\">的模块</font>，webpack 默认处理不了，<font color=\"#c24f4a\">需要调用loader加载器才可以正常打包</font>，否则会报错!</p><p><br/></p><p>loader加载器可以协助webpack 打包处理特定的文件模块，比如:</p><p>&nbsp;&nbsp;&nbsp; ① less-loader 可以打包处理.less相关的文件</p><p>&nbsp;&nbsp;&nbsp; ② sass-loader 可以打包处理.scss相关的文件</p><p>&nbsp;&nbsp;&nbsp; ③url-loader可以打包处理css 中与ur1路径相关的文件</p><p><br/></p><p>loader的调用过程如下图：</p><p><img src=\"/uploads/admin/202207/62ce225ba0cb5.png\" style=\"max-width:100%;\"/></p><p></p>', '1', '', '', '1657676595', '', '', '2', '15', '');
INSERT INTO `cd_content` VALUES ('15', '打包处理 css 文件', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm i style-loader css-loader -D </font>命令，安装处理css文件的 loader</p><p>② 在webpack.config.js 的 <font color=\"#c24f4a\">module -&gt; rules</font> 数组中，添加loader规则如下：</p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;<font color=\"#c24f4a\"> //所有第三方文件模块的匹配规则</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; module: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; { test: /\\.css$/,use: [\'style-loader\',\'css-loader\'] }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p><p>其中,<font color=\"#4d80bf\">test</font>表示匹配的文件类型。<font color=\"#4d80bf\">use</font>表示对应要调用的loader</p><p><font color=\"#c24f4a\">注意：</font></p><p>&nbsp;&nbsp;&nbsp; use数组中指定的loader顺序是固定的</p><p>&nbsp;&nbsp;&nbsp; 多个loader的调用顺序是<font color=\"#4d80bf\">从后往前</font>调用<br/></p>', '1', '', '', '1657678397', '', '', '0', '14', '');
INSERT INTO `cd_content` VALUES ('16', '打包处理less文件', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm i less-loader less -D</font> 命令</p><p>② 在webpack.config.js 的<font color=\"#c24f4a\">module -&gt; rules</font> 数组中，添加loader规则如下：</p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;<font> <font color=\"#c24f4a\">//所有第三方文件模块的匹配规则</font></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; module: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; { test: /\\.less$/,use: [\'style-loader\',\'css-loader\',\'less-loader\'] }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p>', '1', '', '', '1657678567', '', '', '0', '13', '');
INSERT INTO `cd_content` VALUES ('17', '打包处理 scss 文件', '11', '', '<p>① 运行 <font color=\"#c24f4a\">npm i sass-loader node-sass -D</font> 命令</p><p>② 在webpack.config.js 的<font color=\"#c24f4a\">module -&gt; rules</font> 数组中，添加loader规则如下：</p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;<font> //所有第三方文件模块的匹配规则</font></p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; module: {</font></p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: {</font></p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; { test: /\\.sass$/,use: [\'style-loader\',\'css-loader\',\'sass-loader\'] }<br/></font></p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p>', '1', '', '', '1657678742', '', '', '1', '12', '');
INSERT INTO `cd_content` VALUES ('18', '配置 postCSS 自动添加 css 的兼容前缀', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm i postcss-loader autoprefixer -D</font>命令</p><p>② 在项目根目录中创建postcss 的配置文件 postcss.config.js，并初始化如下配置:</p><p>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;<font color=\"#c24f4a\">&nbsp; const autoprefixer = require ( \' autoprefixer\') // 导入自动添加前缀的插件</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; module.exports = {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; plugins: { autoprefixer } //挂载插件<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p><p>③ 在webpack.config.js 的 <font color=\"#c24f4a\">module -&gt; rules</font> 数组中，<font color=\"#c24f4a\">修改</font>css 的 loader 规则如下;</p><p><font>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <font color=\"#c24f4a\">module: {</font></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; { test: /\\.css$/,use: [\'style-loader\',\'css-loader\',\'postcss-loader\'] }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p>', '1', '', '', '1657679118', '', '', '1', '11', '');
INSERT INTO `cd_content` VALUES ('19', '打包样式表中的图片和文字文件', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm i ur1-loader file-loader -D</font>命令</p><p>② 在 webpack.config.js 的<font color=\"#c24f4a\">module -&gt; rules</font> 数组中，添加loader 规则如下:</p><p><font>&nbsp;&nbsp;&nbsp;<font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; module: {</font></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: [<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; test: /\\.jpglpnglgif lbmplttf l eot lsvg / wofflwoff2$/ ,</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; use:\'url-loader?limit=16940\'<br/></font></p><p><font color=\"#c24f4a\"> &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;]<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; }</font></p><p>其中?之后的是 loader 的参数项。</p><p>limit用来指定图片的大小，单位是字节(byte),只有小于1imit 大小的图片，才会被转为 base64图片</p><p><font color=\"#c24f4a\"></font></p>', '1', '', '', '1657679384', '', '', '2', '10', '');
INSERT INTO `cd_content` VALUES ('20', 'webpack 打包发布', '11', '', '<p>上线之前需要通过webpack将应用进行整体打包，可以通过package.json文件配置打包命令:</p><p>&nbsp;&nbsp;&nbsp; <font color=\"#c24f4a\">// 在package.json文件中配置webpack 打包命令</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; // 该命令默认加载项目根目录中的webpack.config.js配置文件</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; \"script\": {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // 用于打包的命令</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <font color=\"#46acc8\">\"build\":&nbsp; \"webpack -p\",</font></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // 用于开发调试的命令</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; \"dev\" : \"webpack-dev-server --open --host 127.0.0.1 --port 3000\",</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; },</font><br/></p><p></p>', '1', '', '', '1657695606', '', '', '1', '9', '');
INSERT INTO `cd_content` VALUES ('21', 'webpack 中配置 vue 组件的加载器', '11', '', '<p>① 运行<font color=\"#c24f4a\">npm i vue-loader vue-template-compiler -D</font> 命令</p><p>② 在webpack.config.js 配置文件中，添加vue-loader 的配置项如下:</p><p>&nbsp;&nbsp;<font color=\"#c24f4a\">&nbsp; const VueLoaderPlugin = require (\'vue-loader/lib/plugin\')</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; module.export = {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; module: {</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; rules: [<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // ...其他规则</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; { test: /\\.vue$/, loader:\'vue-loader\' }<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; ]<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; },</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; plugins: [</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // ...其他插件</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; new VueLoaderPlugin() //请确保引入这个插件！<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; ]<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; }</font></p><p><font color=\"#c24f4a\"><br/></font></p><p><font color=\"#000000\"><br/></font></p><p><font color=\"#c24f4a\"><font color=\"#000000\">③ 导入单文件组件</font><br/></font></p><p>import App from \'./ components/App.vue\'</p>', '1', '', '', '1657698707', '', '', '1', '8', '');
INSERT INTO `cd_content` VALUES ('22', '在 webpack 项目中使用vue', '11', '', '<p>① 运行<font color=\"#c24f4a\"> npm i vue -S </font>安装vue</p><p>② 在src -&gt; index.js 入口文件中，通过<font color=\"#c24f4a\"> import vue from \'vue’</font> 来导入vue构造函数</p><p>③ 创建vue 的实例对象，并指定要控制的el区域</p><p>④ 通过render函数渲染app根组件</p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; // 1.导入vue构造函数</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; import vue from \"vue\"</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; // 2. 导入APP根组件</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; import <font color=\"#46acc8\">App</font> from \'./components/App. vue\'</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; const vm = new Vue ({</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // 3.指定vm实现要控制的页面区域</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; el: \'#app\',</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; // 4.通过render函数，把指定的组件渲染到el区域中</font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; render: h =&gt; h(<font color=\"#46acc8\">App</font>)<br/></font></p><p><font color=\"#c24f4a\">&nbsp;&nbsp;&nbsp; })</font><br/></p>', '1', '', '', '1657699928', '', '', '1', '7', '');
