INSERT INTO `cd_link` VALUES ('1', 'web三大标准', '结构(html)、表现(css)、行为(javascript)', '', '1', '1', '1648134275', '1');
INSERT INTO `cd_link` VALUES ('2', '<html lang=\"zh-CN\">', '<html lang=\"zh-CN\">中文\n<html lang=\"en\">英文', '', '1', '2', '1648134305', '1');
INSERT INTO `cd_link` VALUES ('3', '字符集 编码', '<meta charset=\"UTF-8\">', '', '1', '3', '1648134323', '1');
INSERT INTO `cd_link` VALUES ('4', '将网页里的所有a链接都改成跳转新页面', '<head>\n   <base traget=\"_blank\">\n</head>', '', '1', '4', '1648134358', '1');
INSERT INTO `cd_link` VALUES ('5', '表格标题 在表格上方居中', '<table>\n         <caption>22</caption>\n</table>', '', '1', '5', '1648134381', '1');
INSERT INTO `cd_link` VALUES ('6', '光标点击文字会定位到表单里 for是索引', '<lable for=\"username\">名字</lable><input type = \"text\" id=\"username\" name=\"username\">', '', '1', '6', '1648134409', '1');
INSERT INTO `cd_link` VALUES ('7', '<style></style>技巧', '有h5的声明可以省略<style>中的type = css', '', '1', '7', '1648134481', '2');
INSERT INTO `cd_link` VALUES ('8', '*通配符选择器', '*通配符选择器 会匹配所有的元素（不建议随便使用 会降低页面响应速度）\n例如：*{margin:0;padding:0;}', '', '1', '8', '1648134523', '2');
INSERT INTO `cd_link` VALUES ('9', '子元素选择器', '.header>h3{color:red;}', '', '1', '9', '1648134538', '2');
INSERT INTO `cd_link` VALUES ('10', 'a标签', 'a:link 未访问的链接\na:visited 已访问的链接\na:hover 产鼠标移动到链接上\na:active 选定的链接\n注意：要按照顺序写 否则不生效 lvha', '', '1', '10', '1648134566', '2');
INSERT INTO `cd_link` VALUES ('11', '块元素和行内元素', 'HTML标签—般分为块标签和行内标签两种类型，它们也称块元素和行内元素。\n·行内元素的特点:\n(1)相邻行内元素在一行上，一行可以显示多个。\n(2)高、宽直接设置是无效的。\n(3）默认宽度就是它本身内容的宽度。\n(4）行内元素只能容纳文本或则其他行内元素。\n\n·行内块元素的特点（inline-block）:\n(1）和相邻行内元素(行内块）在一行上,但是之间会有空白缝隙。一行可以显示多个\n(2）默认宽度就是它本身内容的宽度。\n(3）高度，行高、外边距以及内边距都可以控制。', '', '1', '11', '1648134620', '2');
INSERT INTO `cd_link` VALUES ('12', '文本垂直居中', '行高等于高度可以让单行文本垂直居中（line-height）', '', '1', '12', '1648134660', '2');
INSERT INTO `cd_link` VALUES ('13', ' background-postion', 'background-postion:x坐标 y坐标；（xy可以写方位名词也可以写px，如果只指定了一个方位名词，另一个值默认居中对齐）\n超大背景图片一般background-postion:center top;\n', '', '1', '13', '1648134683', '2');
INSERT INTO `cd_link` VALUES ('14', 'background-attachment', 'background-attachment:scoll | fixed 背景附着 滚动或固定 不会随着滚动条的滚动而滚动', '', '1', '14', '1648134697', '2');
INSERT INTO `cd_link` VALUES ('15', 'JS的组成', '1.ECMAscript（JavaScript语法）\n2.DOM（页面文档对象模型）\n3.BOM（浏览器对象模型）', '', '1', '15', '1648134823', '3');
INSERT INTO `cd_link` VALUES ('16', '关键字不能作为变量名、方法名', '包括: break、case、catch、continue、default、delete、do、else、finally、for、function、if、in.instanceof.new、return、switch、this、throw、try、typeof、var、void、while、with等。', '', '1', '16', '1648135540', '3');
INSERT INTO `cd_link` VALUES ('17', 'arguments的用法', '在函数里特有的方法，可以获取对方调用函数时传过来的参数，没有设置形参时可以使用', '', '1', '17', '1648287632', '3');
INSERT INTO `cd_link` VALUES ('18', '从执行效率来看全局变量和局部变量', '(1）全局变量只有浏览器关闭的时候才会销毁，比较占内存资源\n(2）局部变量当我们程序执行完毕就会销毁，比较节约内存资源\n', '', '1', '18', '1648288209', '3');
INSERT INTO `cd_link` VALUES ('19', '预解析', '在当前作用域下, JS 代码执行之前，浏览器会默认把带有 var 和 function 声明（匿名函数没有function声明，所以不会提升）的变量在内存中进行提前声明或者定义。\n\n代码执行： 从上到下执行JS语句。\n预解析会把变量和函数的声明在代码执行之前执行完成。', '', '1', '19', '1648288698', '3');
INSERT INTO `cd_link` VALUES ('20', 'CSS3盒子模型', 'box-sizing:border-box;\n有了这句话 padding与border就不会再撑大盒子了\n一般适用于移动端开发', '', '1', '20', '1655364498', '2');
